tables.table_schema:
CREATE TABLE RegressionModelResults (
	id SERIAL PRIMARY KEY,
	feature_name VARCHAR(255),
	feature_value FLOAT,
	target_variable FLOAT
);

CREATE TABLE RegressionModelMetadata (
	model_id UUID PRIMARY KEY,
	model_name VARCHAR(255),
	training_date DATE,
	accuracy FLOAT
);

CREATE TABLE feature_engineering_results (
    id INT PRIMARY KEY,
    feature_name VARCHAR(50),
    feature_value FLOAT,
    is_numerical BOOL
);

CREATE TABLE model_metrics (
    id INT PRIMARY KEY,
    model_name VARCHAR(50),
    metric_name VARCHAR(50),
    metric_value FLOAT
);

CREATE TABLE model_params (
    id INT PRIMARY KEY,
    model_name VARCHAR(50),
    param_name VARCHAR(50),
    param_value FLOAT
);

CREATE TABLE FeatureEngineeringResults (
   id INT PRIMARY KEY,
   feature_name VARCHAR(255),
   feature_value FLOAT,
   feature_set VARCHAR(255)
);

CREATE TABLE ModelMetrics (
   id INT PRIMARY KEY,
   metric_name VARCHAR(255),
   metric_value FLOAT,
   metric_timestamp TIMESTAMP
);

CREATE TABLE ModelSettings (
   id INT PRIMARY KEY,
   setting_name VARCHAR(255),
   setting_value VARCHAR(255),
   setting_description TEXT
);

CREATE TABLE ModelPrediction (
   id INT PRIMARY KEY,
   model_id INT,
   prediction_value FLOAT,
   prediction_date DATE
);

CREATE TABLE FeatureEngineeringResults (
    id INT PRIMARY KEY,
    feature_name VARCHAR(255),
    feature_value FLOAT,
    target_variable VARCHAR(255)
);

CREATE TABLE RegressionModel (
    id INT PRIMARY KEY,
    model_name VARCHAR(255),
    model_type VARCHAR(255),
    loss_function VARCHAR(255)
);

CREATE TABLE DataSources (
    id INT PRIMARY KEY,
    source_name VARCHAR(255),
    data_type VARCHAR(255),
    data_format VARCHAR(255)
);
